import React, {useState, useEffect} from 'react';
import '../../src/App.css'
import { BrowserRouter as Router, Route, Routes, Link, useLocation } from 'react-router-dom';
import axios from 'axios';


const Explore = () => {
    const [createdEvents, setCreatedEvents] = useState([]);
    const [errorMessage, setErrorMessage] = useState('');

    const fetchCreatedEvents = () => {
        fetch('http://localhost:8000/api/createEvent')
          .then(response => response.json())
          .then(data => {
            // Handle the response from the server if needed
            console.log('Created events fetched successfully:', data);

            // Assuming the server response is an array of created events
            setCreatedEvents(data);
          })
          .catch(error => {
            console.error('Error fetching created events:', error);
            setErrorMessage('Error fetching created events. Please try again.');
          });
      };

      useEffect(() => {
        // Fetch created events when the component mounts
        fetchCreatedEvents();
      }, []);

    return (
        <div>

<ul>
        {createdEvents.map(event => (
          <li key={event.id}>
            <p>Event Name: {event.eventName}</p>
            <p>Start Date: {event.startDate}</p>
            <p>End Date: {event.endDate}</p>
            <p>Location: {event.location}</p>
          </li>
        ))}
      </ul>

        </div>
    )

};

export default Explore;
